import React, { Component } from 'react';

class TodoForm extends Component{
    constructor(props){
        super(props);
        this.state = {inputVal : 'Type Here'};
    }
    render(){
        return(
            <div>
                <input 
                    type="text" 
                    value={this.state.inputVal}
                />
                <button>Add Todo</button>
            </div>
        )
    }
}
export default TodoForm;
